import React from 'react';
import './Intro.css';

const Intro = () => {
  return (
    <>
    <section className='intro-section'>
    <div className='container'>
        <div>
          <p>Hi, </p>
        </div>
    </div>
    </section>
    </>
  )
}

export default Intro
